pragma solidity ^0.8.9;
import "hardhat/console.sol";

contract TipAttendantsContract {
    event TipTransferred(address to, uint amount, address msg);

    Tip[] tips;

    struct Tip {
        address payable metamask_wallet;
        uint tip_amount;
    }

    function tipAttendants(Tip[] memory attendantArray) public  {
        for(uint i=0; i < attendantArray.length; i++){
            tips.push(attendantArray[i]);
        }
//        for(uint i=0; i < tips.length; i++){
            Tip memory tip = tips[0];
//            require(address(this).balance >= tip.tip_amount, "Contract balance is insufficient");

                tip.metamask_wallet.transfer(tip.tip_amount);

            // Optionally, you can emit an event here to log the successful transfer
            emit TipTransferred(tip.metamask_wallet, tip.tip_amount, msg.sender);
//        }
    }

    function getTips() public view returns (Tip[] memory) {
        return tips;
    }
}

